import {Link} from 'react-router-dom';
export default class NavigationBar extends React.Component{
	constructor(props) {
		super(props);
		this.state = {};
	  }

	getNavItem(item){
		return(item.children == null ?
						<Nav.Link as={Link} to={item.url} className="nav-link">{item.name}</Nav.Link> :
						<NavDropdown title={item.name} id="basic-nav-dropdown">
							{
								item.children.map((item)=>this.getNavItem(item))
							}

						</NavDropdown>)
	}
